INSERT INTO Movies(ID,MOVIE_NAME,POSTER,RANK,RELEASE_DATE,DESCRIPTION) VALUES  (147603,'Hollow Man','https://m.media-amazon.com/images/M/MV5BMmFjMzY0ZjgtMjZhOC00MTRlLWEyM2EtYjBhOGVlMTQ0MTgzXkEyXkFqcGdeQXVyMTUzMDUzNTI3._V1_FMjpg_UX1000_.jpg',5.3,2000,'A brilliant scientist''s discovery renders him invisible, but transforms him into an omnipotent, dangerous megalomaniac.');
INSERT INTO Movies(ID,MOVIE_NAME,POSTER,RANK,RELEASE_DATE,DESCRIPTION) VALUES  (167324,'JFK','https://m.media-amazon.com/images/M/MV5BYjYyODExMDctZjgwYy00ZjQwLWI4OWYtOGFlYjA4ZjEzNmY1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_FMjpg_UX1000_.jpg',7.8,1991,'New Orleans District Attorney Jim Garrison discovers there''s more to the Kennedy assassination than the official story.');
