INSERT INTO Movies(ID,MOVIE_NAME,POSTER,RANK,RELEASE_DATE,DESCRIPTION) VALUES  (176712,'Kill Bill: Vol. 2','https://m.media-amazon.com/images/M/MV5BNmFiYmJmN2QtNWQwMi00MzliLThiOWMtZjQxNGRhZTQ1MjgyXkEyXkFqcGdeQXVyNzQ1ODk3MTQ@._V1_FMjpg_UX1000_.jpg',8.2,2004,'The Bride continues her quest of vengeance against her former boss and lover Bill, the reclusive bouncer Budd, and the treacherous, one-eyed Elle.');
INSERT INTO Movies(ID,MOVIE_NAME,POSTER,RANK,RELEASE_DATE,DESCRIPTION) VALUES  (192017,'Little Mermaid, The','https://m.media-amazon.com/images/M/MV5BN2JlZTBhYTEtZDE3OC00NTA3LTk5NTQtNjg5M2RjODllM2M0XkEyXkFqcGdeQXVyNjk1Njg5NTA@._V1_FMjpg_UX1000_.jpg',7.3,1989,'A young mermaid makes a deal with a sea witch, to trade her beautiful voice for human legs so she can discover the world above water and impress a prince.');
