INSERT INTO Movies(ID,MOVIE_NAME,POSTER,RANK,RELEASE_DATE,DESCRIPTION) VALUES  (210511,'Memento','https://m.media-amazon.com/images/M/MV5BZTcyNjk1MjgtOWI3Mi00YzQwLWI5MTktMzY4ZmI2NDAyNzYzXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_FMjpg_UX1000_.jpg',8.7,2000,'A man with short-term memory loss attempts to track down his wife''s murderer.');
