INSERT INTO Movies(ID,MOVIE_NAME,POSTER,RANK,RELEASE_DATE,DESCRIPTION) VALUES  (306032,'Snatch.','https://m.media-amazon.com/images/M/MV5BMTA2NDYxOGYtYjU1Mi00Y2QzLTgxMTQtMWI1MGI0ZGQ5MmU4XkEyXkFqcGdeQXVyNDk3NzU2MTQ@._V1_.jpg',7.9,2000,'Unscrupulous boxing promoters, violent bookmakers, a Russian gangster, incompetent amateur robbers and supposedly Jewish jewelers fight to track down a priceless stolen diamond.');
